    row["marked"] = !row["marked"];
  }

  ngAfterContentInit() {
    if (!this.ColumnsDef) {
      return
    }

    this.ColumnsDef.forEach((ColumnsDef) => {
      this.listFields.push(ColumnsDef.name);
      this.table.addColumnDef(ColumnsDef)
    })
  }

}

